import './App.css';
import axios from "axios"
import { useEffect,useState  } from "react";
function App() {
  const [listofPosts,setListOfPosts]=useState([])
  useEffect(()=>{
    axios.get("http://localhost:3001/posts").then((respone)=>{
      setListOfPosts(respone.data)
    })
  },[])
  return (
    <div className="App">
     {listofPosts.map((value,key)=>{
      return <div> {value}</div>
     })}
    </div>
  );
}

export default App;
